import React from 'react';
import Spinner from "../Spinner/Spinner";
import {Route} from "react-router-dom";
import HomePage from "../Pages/HomePage";


class App extends React.Component {
    render() {
        return (
                <div>
                    <Route render={()=><HomePage/>}/>
                </div>
        );
    }
}
export default App;
